<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Our Scrapbook ðŸ“”</title>
  <link href="https://fonts.googleapis.com/css2?family=Quicksand:wght@400;600&display=swap" rel="stylesheet">
  <style>
    body {
      font-family: 'Quicksand', sans-serif;
      background: linear-gradient(135deg, #ffe0eb, #ffd6f0);
      margin: 0;
      padding: 20px;
      color: #4b2e5a;
    }
    .container {
      max-width: 1000px;
      margin: auto;
      background: #fff4f8;
      padding: 40px 30px;
      border-radius: 25px;
      box-shadow: 0 8px 25px rgba(0,0,0,0.1);
    }
    h1 {
      text-align: center;
      font-size: 2.5em;
      margin-bottom: 30px;
      color: #d6336c;
    }
    nav {
      text-align: center;
      margin-bottom: 40px;
    }
    nav a {
      text-decoration: none;
      margin: 0 10px;
      color: #fff;
      font-weight: bold;
      background: #d6336c;
      padding: 10px 18px;
      border-radius: 12px;
      transition: 0.3s;
    }
    nav a:hover { background: #b82b59; }

    /* Scrapbook styling */
    .scrapbook {
      display: flex;
      flex-wrap: wrap;
      gap: 30px;
      justify-content: center;
    }
    .photo {
      background: #fff0f6;
      padding: 10px;
      border-radius: 15px;
      box-shadow: 0 6px 18px rgba(0,0,0,0.1);
      width: 250px;
      transform: rotate(-3deg);
      transition: transform 0.2s;
      position: relative;
    }
    .photo:nth-child(even) { transform: rotate(3deg); }
    .photo:hover { transform: scale(1.05); z-index: 2; }
    .photo img {
      width: 100%;
      border-radius: 10px;
    }
    .caption {
      text-align: center;
      font-size: 0.95em;
      margin-top: 8px;
      color: #4b2e5a;
    }
    .photo::before {
      content: "";
      width: 60px;
      height: 20px;
      background: rgba(255,255,200,0.8);
      position: absolute;
      top: -10px;
      left: 50%;
      transform: translateX(-50%) rotate(-5deg);
      border-radius: 3px;
      box-shadow: 0 2px 5px rgba(0,0,0,0.2);
    }
  </style>
</head>
